import blackTankTop from '../Images/blackTankTop.png';
import blueHat from '../Images/blueHat.png';
import blackPants from '../Images/blackpants.png';
import pinkShirt from '../Images/pinkLongSleeve.png';

const images = {
    blackTankTop,
    blueHat,
    blackPants,
    pinkShirt
};

export default images;
